import React from 'react';
import List from "../../components/List/ListItem";
import AppContext from "../../context";
const ArticlesView = () => (
    <AppContext.Consumer>
      {(context) => (
        <List items={context.article} />
      )}
    </AppContext.Consumer>
  );
  
export default ArticlesView;
